import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route, Switch } from 'react-router-dom';
import Home from './components/Home';
import NavBarComp from './components/NavBarComp';
import Products from './components/ProductsComponent/Products';
import SingleProduct from './components/SingleProduct/SingleProduct';
import NotFoundPage from './components/NotFoundPage/NotFoundPage';
import BookSearch from './components/SearchComponent/BookSearch';
import Footer from './components/footer/Footer';
import CartComponent from '../src/components/CartComponent/CartComponent/CartComponent';
import Banner from './components/Logo/Logo';
import HomePage from './Pages/HomePage';

function App() {
  return (
    <Router>
      <div className="App">
        <NavBarComp />
        <Switch>
          <Route path='/' element={<HomePage />} />
          <Route path='/products' element={<Products />} />
          <Route path='/books/:isbn' element={<SingleProduct />} />
          <Route path='/cart' element={<CartComponent />} />
          <Route path='/footer' element={<Footer />} />
          {/* <Route path='*' element={<NotFoundPage />} /> */}
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
